  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Missisquoi NWR
  outlines Refuge accomplishments from January through April of 1956. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  mammals, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, vegetation control, and prescribed
  burning. Resource management is outlined; topics include fur harvesting and timber
  removal. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes Refuge visitors,
  hunting, fishing, and violations. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
